    "2016-03-10T05:36:06.960672",nt"name": "lead-paint-contractors",nt"isopen":
    false,nt"url": null,nt"notes": "The Residential, Commercial and Public
    Building Contractors (RC) listed have been accredited by the Maryland Department
    of the Environment to provide lead paint abatement services.rnThere are two kinds
    of lead paint supervisors who may perform lead paint abatement work on residential,
    commercial and public buildings. They qualify in the following ways:rnu2022tMaintenance
    & Repainting Supervisor (S4) - May provide oversight of Lead Paint Abatement Workers
    and perform work for activities such as minor repairs, painting and window replacement.rnu2022tRemoval
    & Demolition Supervisor (S2) u2013 Also known as an Abatement Supervisor. May provide
    oversight of Lead Paint Abatement Workers and perform work from minor repairs and
    painting to major renovations, demolitions and lead paint abatement projects.rnLead
    Paint Abatement Workers are to have their current training ID card in their possession
    while performing lead paint abatement. There is no accreditation for them but are
    to work under the supervision of an accredited Lead Paint Abatement Supervisor.rnrnDisclaimer:rnFor
    your convenience MDE publishes this list of accredited lead contractors that meet
    Marylandu2019s standards to perform abatement activities involving lead-based paint.
    The list is an information resource only. MDE does not endorse any of the contractors
    included on this list nor does MDE provide any warranty about their performance.
    Consumers are advised to request bids and conduct reference checks before hiring.
    Contact the individual contractors for information regarding services and fees.
    Verify with the contractor you are going to hire that the supervisor is accredited
    by MDE and all lead paint abatement workers have current training. This accreditation
    and training does not satisfy the EPA Renovation, Repair and Painting (RRP) Rule.",nt"license_title":
